import React from "react";
import { Link } from "react-router-dom";
import SideBar from "./SideBar";

const NavBar = () => {
  return (
    <nav class="bg-blue-100 flex gap-20">
      <div>
        <SideBar />
      </div>

      <div className="z-50 bg-blue-500 ml-50">text</div>
    </nav>
  );
};

export default NavBar;
